// import { useState } from "react";

const Prices = (props) => {
  //   const [coinData] = useState({
  //     currency: "USD",
  //   });

  const usableCoinData = Object.entries(props.bpi.bpi);
  console.log(usableCoinData);
  return (
    <div>
      <ul>
        <li>
          {`Bitcoin rate for ${props.bpi.bpi.USD.description} : ${props.bpi.bpi.USD.symbol}${props.bpi.bpi.USD.rate}`}
        </li>
      </ul>
    </div>
  );
};

export default Prices;
